t24App.controller('gasThankUCtrl', ['$scope','appService','$log','$stateParams','$state', function($scope,appService,$log,$stateParams,$state){
	console.log('gasThankUCtrl');
	$scope.loadGetTxnHistory = function(){
		appService.getTxnHistory("226C6A09F967F7B7149DDE8C0E78172DFD82DEF81EE45E3480EFEB9C350D8BF906FBEC88ABD230C5","8976595947",function(response){
			console.log("sdfasdf",response);
			if (response.msgDesc == "Success" && response.isSuccessful == true) {
				$scope.txnHistoryDetails = response.data[response.data.length-1];
				console.log($scope.txnHistoryDetails);
				appService.payUTxnStatusCheck("226C6A09F967F7B7149DDE8C0E78172DFD82DEF81EE45E3480EFEB9C350D8BF906FBEC88ABD230C5","8976595947",$scope.txnHistoryDetails.txnNo,function(response){
					console.log(response);
					switch(response.data[0].paymentStatus){
						case '15050': $scope.status = "Payment Successful";
						break;
						case '15999': $scope.status = "Payment Failure";
						break;
						case '15998': $scope.status = "Pending : Temporary Failure";
						break;
						case '15020': $scope.status = "Invalid Transaction";
						break;
						case '15010': $scope.status = "Processing";
						break;
						default :console.log("payment status is not matched");
						break;
					}
				});
			}
		});
	};
	
	$scope.loadGetTxnHistory();


}]);
